    description: '临近港口的海岸线占塔科夫郊区的很大一部分。 \n\n这个区域包含被废弃的村庄、现代化私人住宅、遍布海岸线的船运设施、加油站、气象观测站、通讯基站及其他商业设施。海岸线的核心区域是“Azure Coast”疗养院。这个疗养院由数栋奢华的建筑组成，由附近的水电站提供独立供电。为了准备塔科夫港口的撤离行动，这里曾被TerraGroup及其相关部门用作临时员工宿舍。',
